import React from 'react';
import { Text,StyleSheet, View, TouchableOpacity } from 'react-native';
import { FontAwesome5 } from '@expo/vector-icons'; 

const Icons =props => {
        return (
       <View style={styles.itemView}>
         <TouchableOpacity>
           <FontAwesome5 name="temperature-high" style={styles.itemFont} />
          
         </TouchableOpacity>
           <Text>Lundi 12 Mars 2021</Text> 
        </View>
        );
      };
    // create style to component
    const styles = StyleSheet.create({
      itemView: {
        backgroundColor: 'white',
        height:150,
        margin:10,
        marginRight:15,
        marginLeft:50,
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        
        elevation: 24,
      },
      itemFont: {
       color:'red',
       fontSize:24,
       marginTop:20,
       marginLeft:30,
       backgroundColor: 'white',
       borderRadius: 500,
       width:60,
       padding:20,
       shadowColor: "#000",
       shadowOffset: {
         width: 0,
         height: 16,
       },
       shadowOpacity: 0.58,
       shadowRadius: 16.00,
       
       elevation: 24,
   
      },
       
      });
    //Export to component so we can use it elsewhere in our project
    export default  Icons ;
